import React from 'react';

import Game from '../../shared/pages/Game'
import './Ss7R.css';

const Ss7R = () => {
    const defaultPlayers = [
        {id: 'p1', name: 'acetone7', splayed: 3, swins: 0, mwins: 3, ischecked: 'false' },
        {id: 'p1', name: 'mom', splayed: 3, swins: 0, mwins: 3, ischecked: 'false' },
        {id: 'p1', name: 'dad', splayed: 3, swins: 0, mwins: 3, ischecked: 'false' }
    ]

    return (
        <div className="game-container">
            <Game playing={defaultPlayers}/>
            <button>Done!</button>
        </div>
    )
};


export default Ss7R;
